import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'

export default class DashboardMovieRow extends React.Component {
	constructor(props) {
		super(props);
	}

	/* ---- Q1b (Dashboard) ---- */
	/* Change the contents (NOT THE STRUCTURE) of the HTML elements to show a movie row. */

	submitLocation(lat, long) {
	fetch(`http://localhost:8081/zones/${lat}/${long}`, {
    method: 'GET' // The type of HTTP request.
	})
	.then(res => res.json())
	.then(zoneList => {
		if(!zoneList) return;
		console.log(zoneList);
	})
	}

	render() {
		return (
			<>
			<div className="location">
				<div className="name">{this.props.name}</div>
				<div className="lat">{this.props.lat}</div>
				<div className="lon">{this.props.lon}</div>
			</div>
			<span class="label label-success" onClick={() => this.submitLocation(this.props.lat, this.props.lon)} >Select</span>
			</>
		);
	}
}
